    "description": " Esp8266 12V 2 Kanal Röle Modülü Esp01 Wireless Modül Esp8266 Esp01 Wifi Röle Modülü wifi modülü olarak ESP-01 kullanır. 8 bit MCU ile uyumlu olan bu modül basit bir kurulum ile cep telefonlarından kolaysa sistem kontrolü için kullanılabilir.Esp8266 2 Kanal 12V Esp01 Wifi Röle Modülü ÖzelliklerAçık bir ortamda, cep telefonu kazanma modülüne monte edildiğinde, maksimum sabit iletim mesafesi 100m'dir.WIFI modülü ve cep telefonu aynı anda yönlendiriciye kurulduğunda, iletim mesafesi yönlendiricinin sinyal gücüne bağlıdır.Cep telefonu APP'de ESP-01'i tamamlamak için Smartconfig teknolojisini kullanınWIFI hesabı yapılandırma şifre modülü, yapılandırılan hesap ve şifre, kapanma hafıza fonksiyonuna sahiptir.Bünyesindekiler 100.000 defa arka arkaya bağlanabilen 10A / 250V AC 10A / 30V DC rölelerdir.İki kutuplu efüzyon koruması ile kısa tepki süresine sahiptir. Yerleşik mod seçimi ve gerçek zamanlı çalışma durumu göstergesi mevcuttur.İndirmek için UART hata ayıklama arayüzü ve STM8 SWIM arayüz programı kullanılmalıdır.Android uygulamalar ile uyumludur.Pin Diyagram Tanımlama :IN +, IN-: 12V güç girişiTX, RX: UART pin seri bağlantı noktası12V, GND, SWIM, NRST: STM8S mikrodenetleyici port programı indirS1 düğmesi: mod anahtarı, varsayılan mod 1'dirS2 düğmesi: Fabrika ayarlarını geri yükleLED D2 ve D4 (kırmızı ışık): röle çalışma göstergesi, açıkken yanarLED D7 (kırmızı ışık): Mod 1 göstergesiLED D5 (mavi ışık): Mod 2 göstergesiLED D6 (yeşil ışık): çalışma durumu göstergesiİki ayrılmış jumper kapağı: ESP-01 formunda hata ayıklamak için USB'den TTL'ye seri bağlantı noktası modülünü kullanmak istiyorsanız, lütfen normal kullanım sırasında alt uca takın (yani, RX1'e bağlı RX1, TX1'e bağlı TX), lütfen en üste girin (Aksi takdirde parazit olabilir).COM1: terminalNC1: normalde kapalı uç, röle, içeri çekmeden önce COM1 ile kısa devre yapar ve içeri çekmeden sonra kilitlenir.N01: Normalde açık, röle kapanmadan önce kilitlenir ve kapandıktan sonra COM1'e kısa devre yapar.COM2: terminalNC2: Normalde kapalı uç, röle, içeri çekmeden önce COM2 ile kısa devre yapar ve içeri çekmeden sonra kilitlenirN02: Normalde açık, röle kapanmadan önce kilitlenir ve kapandıktan sonra COM2'ye kısa devreKontrol komut rölesi (hex hex formatı): İlk röleyi açın: AO 01 01 UN 2 / Birinci röleyi kapatın: UN 0 01 00 UN 1 / İkinci röleyi açın: UN 0 02 01 UN 3 / İkinci röleyi kapatın: UN 0 02 00 UN 2Pin Diyagram Açıklama (Led D6) :Kapalı ise : otomatik olarak yapılandırıldığı veya yönlendiriciyle olan bağlantısını kaybettiği anlamına gelir0.5s ' de yanıp sönüyor ise : uygulamanın ESP-01 için bir WIFI modül hesabı yapılandırmasını beklemek anlamına gelir2s yavaş yanıp sönüyor ise : Cep telefonu ile bir TCP bağlantısı kurulmasını bekleyen yapılandırmanın tamamlandığı anlamına gelir.Sabit ışık : Cep telefonu ile başarılı bir TCP bağlantı kurulduğunu gösterir.Faydalı LinklerWifi Röle Kartları ürünlerimizi inceleyebilirsiniz. Kablosuz Haberleşme ürünlerimizi inceleyebilirsiniz. "
